docs/integration-testing/.body:
통합 테스트
글로벌 Promise가 필요합니다.
Redux Saga Test Plan은 통합 테스트를 위해 saga가 반환하는 이팩트를 검증하기 위한 API를
반환하는 expectSaga함수를 제공합니다. expectSaga를 사용하기 위해서는 제너레이터 함수를 
첫 번째 인수로 전달합니다. 그리고 그 제너레이터 함수에 전달될 인수들을 추가적으로 전달합니다.

expectSaga는 Redux Saga의 runSaga 함수를 사용하여 saga를 실행하기 때문에 실제 앱에서
동작 하는 것처럼 실행될 것입니다. saga가 비동기적으로 실행되는 것 처럼 expectSaga 역시 비동기적으로
실행됩니다.

expectSaga를 호출하고 검증문을 작성한 후에 run 메서드로 saga를 시작할 수 있습니다. run
메서드는 Promise를 반환하고 당신이 좋아하는 테스팅 프레임워크와 함께 사용할 수 있습니다. 검증이
실패한다면 expectSaga는 반환된 Promise를 리젝트(reject)할 것입니다. 모든 검증이 통과되면,
Promise는 리졸브(resolve)될 것입니다.

다음 예제는 테스팅 프레임워크로 Jest를 사용했습니다. 
테스트가 완료될때 Jest가 알 수 있도록 Promise를 반환합니다. 그리고 expectSaga로 call을 
테스트하지도 않았습니다.

import { call, put } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';

function* mainSaga(x, y) {
  yield call([console.log, console], 'hello');
  yield put({ type: 'ADD', payload: x + y });
}

it('puts an ADD action', () => {
  return expectSaga(mainSaga, 40, 2)
    // saga가 최종적으로 예상되는 액션을 `put` 하는지 검증합니다.
    .put({ type: 'ADD', payload: 42 })

    // run it
    .run();
});

docs/integration-testing/dispatching.htm.body:
Dispatching Actions
Most sagas use the take effect to wait on Redux actions. Because expectSaga
runs your saga as normal, it will block on yielded take effects. To ensure
your saga can keep running, expectSaga also has a dispatch method. Before
running your saga, dispatch any actions you expect your saga to take in the
order it takes them. Internally, expectSaga will queue the actions and
dispatch them on your behalf as needed.
import { put } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';

function* mainSaga(x, y) {
  yield take('HELLO');
  yield put({ type: 'ADD', payload: x + y });
  yield take('WORLD');
  yield put({ type: 'DONE' });
}

it('handles dispatching actions', () => {
  return expectSaga(mainSaga, 40, 2)
    // note that assertions don't have to be in order
    .put({ type: 'DONE' })
    .put({ type: 'ADD', payload: 42 })

    // dispatch any actions your saga will `take`
    // dispatched actions MUST be in order
    .dispatch({ type: 'HELLO' })
    .dispatch({ type: 'WORLD' })

    .run();
});

Dispatch actions while saga is running
You can also dispatch actions while a saga is running. This is useful for
delaying actions so Redux Saga Test Plan doesn't dispatch them too quickly.
function* mainSaga() {
  // Received almost immediately
  yield take('FOO');

  // Received after 250ms
  yield take('BAR');
  yield put({ type: 'DONE' });
}

const delay = time => new Promise((resolve) => {
  setTimeout(resolve, time);
});

it('can dispatch actions while running', () => {
  const saga = expectSaga(mainSaga);

  saga.put({ type: 'DONE' });

  saga.dispatch({ type: 'FOO' });

  const promise = saga.run({ timeout: false });

  return delay(250).then(() => {
    saga.dispatch({ type: 'BAR' });
    return promise;
  });
});

Delaying dispatching actions with .delay()
While being able to dispatch actions while the saga is running has use cases
besides only delaying, if you just want to delay dispatched actions, you can use
the delay method. It takes a delay time as its only argument.
function* mainSaga() {
  // Received almost immediately
  yield take('FOO');

  // Received after 250ms
  yield take('BAR');
  yield put({ type: 'DONE' });
}

it('can delay actions', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DONE' })
    .dispatch({ type: 'FOO' })
    .delay(250)
    .dispatch({ type: 'BAR' })
    .run({ timeout: false });
});

docs/integration-testing/timeout.html.body:
Timeout
Because expectSaga runs sagas asynchronously, it has a default timeout in case
your saga runs too long. This is needed for sagas that have multiple
asynchronous actions, that have infinite loops, or that use saga helpers like
takeEvery. expectSaga will cancel your saga if it times out and print a
warning message.
function* mainSaga() {
  while (true) {
    const action = yield take('READY');
    yield put({ type: 'DATA', payload: action.payload });
  }
}

it('times out', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DATA', payload: 42 })
    .dispatch({ type: 'READY', payload: 42 })

    // saga never terminates on its own
    // implicit timeout of 250ms will cancel saga
    // and print warning message to console
    .run();
});

Silencing Warnings
The warning message is typically useful if a saga without an infinite loop is
taking too long. If you have a saga with an infinite loop, though, you will want
it to time out. Therefore, to silence the warning message, you can call the
silentRun method instead. It functions the same as the run method but
suppresses timeout warnings from Redux Saga Test Plan. NOTE: this will not
suppress any timeout warnings from your test runner (e.g. Jest).
it('can be silenced', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DATA', payload: 42 })
    .dispatch({ type: 'READY', payload: 42 })

    // no warning message will be printed
    // this is useful if you expect the saga to time out
    .silentRun();
});

The old method of silencing timeouts by passing a silenceTimeout option into
run is still available, but you're encouraged to use the cleaner silentRun
method.
it('can be silenced', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DATA', payload: 42 })
    .dispatch({ type: 'READY', payload: 42 })

    // still works, but more to type
    .run({ silenceTimeout: true });
});

Adjusting Timeout
Instead of silencing warnings, you can adjust the timeout length. The default
timeout length is 250 milliseconds. You can change the default timeout by
setting the DEFAULT_TIMEOUT property of expectSaga in milliseconds.
expectSaga.DEFAULT_TIMEOUT = 500; // set it to 500ms

If you want to override the timeout for a particular test case, then you can
pass in a timeout length to the run (or silentRun) method.
const delay = time => new Promise(resolve => setTimeout(resolve, time));

function* mainSaga() {
  yield call(delay, 300);
  yield put({ type: 'HELLO' });
}

it('can have a different timeout length', () => {
  return expectSaga(mainSaga)
    .put({ type: 'HELLO' })

    // saga will take at least 300ms,
    // so time out after 500ms to be safe
    .run(500);
});

Alternatively, you can opt out of the timeout behavior and force expectSaga to
wait until your saga is done on its own by passing in false to the run
method. WARNING: this won't work with sagas with infinite loops because the
saga will never finish on its own.
it('never times out', () => {
  return expectSaga(mainSaga)
    .put({ type: 'HELLO' })

    // wait until the saga finishes on its own
    .run(false);
});

