docs/integration-testing/partial-matchin.body:
Partial Matching Assertions
Sometimes you're not interested in the exact arguments passed to a call effect
creator or the payload inside an action from a put effect. Instead you're only
concerned with if a particular function was invoked via call or if a
particular action type was dispatched via put. You can handle these situations
with partial matcher assertions.
The following assertions have a like method along with convenient helper
methods for partially matching assertions:

actionChannel
apply
call
cps
fork
put
put.resolve
select
spawn

NOTE: the like method requires knowledge of the properties on effects such
as the fn property of call and the action property of put. Essentially,
like allows you to match effects with certain properties without worrying
about the other properties. Therefore, you can match a call by fn without
worrying about the args property.
Example
Here is a simple example using like:
function* userSaga(id) {
  try {
    const user = yield call(api.fetchUser, id);
    yield put({ type: 'RECEIVE_USER', payload: user });
  } catch (e) {
    yield put({ type: 'FAIL_USER', error: e });
  }
}

it('fetches user', () => {
  return expectSaga(userSaga)
    .call.like({ fn: api.fetchUser })
    .run();
});

it('fails', () => {
  return expectSaga(userSaga)
    .provide({
      call() {
        throw new Error('Not Found');
      },
    })
    .put.like({ action: { type: 'FAIL_USER' } })
    .run();
});

Notice that we can assert that the api.fetchUser function was called without
specifying the arguments. We can also assert in a failure scenario that an
action of type FAIL_USER was dispatched without worrying about the error
property of the action.
Helper Methods Example
We can simplify the previous example with the convenient matcher helper methods
call.fn and put.actionType:
function* userSaga(id) {
  try {
    const user = yield call(api.fetchUser, id);
    yield put({ type: 'RECEIVE_USER', payload: user });
  } catch (e) {
    yield put({ type: 'FAIL_USER', error: e });
  }
}

it('fetches user', () => {
  return expectSaga(userSaga)
    .call.fn(api.fetchUser)
    .run();
});

it('fails', () => {
  return expectSaga(userSaga)
    .provide({
      call() {
        throw new Error('Not Found');
      },
    })
    .put.actionType('FAIL_USER')
    .run();
});

Multiple Properties
If you need it in rare cases, you can match on multiple shallow or deep
properties via like:
function* saga(id) {
  yield put({
    type: 'FOO',
    payload: 42,
    meta: { hello: 'world' },
  });

  // This will be matched
  yield put({
    type: 'FOO',
    payload: 43,
    meta: { hello: 'world' },
  });
}

it('can match on multiple properties', () => {
  return expectSaga(saga)
    .put.like({
      action: {
        type: 'FOO',
        payload: 43,
      },
    })
    .run();
});

Helper Methods
There are other some common helper methods like fn and actionType available,
appropriate to the kind of effect:



Method
Description




actionChannel.pattern
Match actionChannel by pattern. Useful if you use custom buffers with actionChannel.


apply.fn
Match apply by fn.


call.fn
Match call by fn.


cps.fn
Match cps by fn.


fork.fn
Match fork by fn.


put.actionType
Match put by action.type.


put.resolve.actionType
Match put.resolve by action.type.


select.selector
Match select by selector function.


spawn.fn
Match spawn by fn.

docs/integration-testing/negated-asserti.body:
Negated Assertions
You can negate assertions too. Use the not property before calling an
assertion. Negated assertions also work with partial matcher assertions!
function* authSaga() {
  const token = yield select(authToken);

  if (token) {
    yield call(api.setToken, token);
  }
}

it('does not set the token', () => {
  return expectSaga(authSaga)
    .withState({})
    .not.call.fn(api.setToken)
    .run();
});

docs/integration-testing/exposed-effects.body:
Exposed Effects
The Promise returned by the run method resolves with an object that contains
any effects yielded by your saga and sagas that it forked. You can use this for
finer-grained control over testing exact number of effects. Be careful when
testing top-level sagas that fork other sagas because the effects object will
include yielded effects from all forked sagas too. There currently is no way to
distinguish between effects yielded by the top-level saga and forked sagas.
function* userSaga(id) {
  const user = yield call(fetchUser, id);
  const pet = yield call(fetchPet, user.petId);

  yield put({ type: 'DONE', payload: { user, pet } });
}

it('exposes effects', () => {
  const id = 42;
  const petId = 20;

  const user = { id, petId, name: 'Jeremy' };
  const pet = { name: 'Tucker' };

  return expectSaga(saga, id)
    .provide([
      [call(fetchUser, id), user],
      [call(fetchPet, petId), pet],
    ])
    .run()
    .then((result) => {
      const { effects } = result;

      expect(effects.call).toHaveLength(2);
      expect(effects.put).toHaveLength(1);

      expect(effects.call[0]).toEqual(call(fetchUser, id));
      expect(effects.call[1]).toEqual(call(fetchPet, petId));

      expect(effects.put[0]).toEqual(
        put({ type: 'DONE', payload: { user, pet } })
      );
    });
});

Of course, async functions work nicely with this feature too.
it('exposes effects using async functions', async () => {
  const id = 42;
  const petId = 20;

  const user = { id, petId, name: 'Jeremy' };
  const pet = { name: 'Tucker' };

  const { effects } = await expectSaga(saga, id)
    .provide([
      [call(fetchUser, id), user],
      [call(fetchPet, petId), pet],
    ])
    .run();

  expect(effects.call).toHaveLength(2);
  expect(effects.put).toHaveLength(1);

  expect(effects.call[0]).toEqual(call(fetchUser, id));
  expect(effects.call[1]).toEqual(call(fetchPet, petId));

  expect(effects.put[0]).toEqual(
    put({ type: 'DONE', payload: { user, pet } })
  );
});

Inspect Specific Properties
If you want to inspect specific properties on an effect, you can use the
asEffect util from Redux Saga.
import { asEffect } from 'redux-saga/utils';

it('can test properties on effects', () => {
  const id = 42;
  const petId = 20;

  const user = { id, petId, name: 'Jeremy' };
  const pet = { name: 'Tucker' };

  return expectSaga(saga, id)
    .provide([
      [call(fetchUser, id), user],
      [call(fetchPet, petId), pet],
    ])
    .run()
    .then((result) => {
      const { effects } = result;

      const fetchUserCall = asEffect.call(effects.call[0]);

      expect(fetchUserCall.fn).toBe(fetchUser);
      expect(fetchUserCall.args).toEqual([42]);
    });
});

All Effects
If you want all the effects consolidated in the order they were yielded, you can
use the allEffects property from the resolved object.
function* saga() {
  yield call(identity, 42);
  yield put({ type: 'HELLO' });
}

it('exposes all yielded effects in order', () => {
  return expectSaga(saga)
    .run()
    .then((result) => {
      const { allEffects } = result;

      expect(allEffects).toEqual([
        call(identity, 42),
        put({ type: 'HELLO' }),
      ]);
    });
});

Available Effects
The available effects are:

actionChannel
call
cps
fork
getContext
join
put
race
select
setContext
take

