docs/integration-testing/return-value.ht.body:
Return Value
You can assert the return value of a saga via the returns method. This only
works for the top-level saga under test, meaning other sagas that are invoked
via call, fork, or spawn won't report their return value.
function* saga() {
  const data = yield call(someApi);
  return data;
}

it('returns a greeting', () => {
  return expectSaga(saga)
    .provide([
      [call(someApi), { hello: 'world' }],
    ])
    .returns({ hello: 'world' })
    .run();
});

The Promise returned from run also resolves with the top-level saga's return
value.
it('exposes the return value', () => {
  return expectSaga(saga)
    .provide([
      [call(someApi), { hello: 'world' }],
    ])
    .run()
    .then((result) => {
      expect(result.returnValue).toEqual({ hello: 'world' });
    });
});

it('exposes the return value using async/await', async () => {
  const { returnValue } = await expectSaga(saga)
    .provide([
      [call(someApi), { hello: 'world' }],
    ])
    .run();

  expect(returnValue).toEqual({ hello: 'world' });
});

docs/integration-testing/thrown-errors.h.body:
Thrown Errors
You can assert that the saga throws a particular error using the throws method:
function* saga() {
  throw new Error();
}

it('throws an error of type Error', () => {
  return expectSaga(saga)
    .throws(Error)
    .run();
});

It is also possible to match errors by [exact] value, which is useful for matching plain object errors:
function* saga() {
  throw { message: 'Plain Object Error' };
}

it('throws a plain object error', () => {
  return expectSaga(saga)
    .throws({ message: 'Plain Object Error' })
    .run();
});

Other assertions are also checked when an error is thrown. This can be used to verify cleanup code etc:
function* saga() {
  yield put({ type: 'API_STARTED' });

  try {
    yield call(callApi, '/users/', 'get');
  } catch (e) {
    yield put({ type: 'API_FAILED' });
    throw e;
  }

  yield put({ type: 'API_SUCCESS' });
}

it('cleans up on API error', () =>
  expectSaga(saga)
    .provide([
      [matchers.call.fn(callApi), throwError(apiError)],
    ])
    .put({ type: 'API_STARTED' })
    .call.fn(callApi)
    .put({ type: 'API_FAILED' })
    .throws(apiError)
    .run());

Negated assertions also work, however you must be wary that if the saga throws errors that don't match, the test will pass silently:
function* saga() {
  throw new Error();
}

// This test will pass!
it('doesnt throw an error of type CustomErrorType', () => {
  return expectSaga(saga)
    .not.throws(CustomErrorType)
    .run();
});

// This test will fail
it('doesnt throw an error of type Error', () => {
  return expectSaga(saga)
    .not.throws(Error)
    .run();
});

docs/integration-testing/forked-sagas.ht.body:
Forked Sagas
expectSaga assertions not only work for your main saga, but also for forked
sagas. Here is a minimal example where we can assert from a behavior perspective
that the saga(s) put the FORKED action regardless of which saga actually
puts it.
function* otherSaga() {
  yield put({ type: 'FORKED' });
}

function* saga() {
  yield fork(otherSaga);
}

function* sagaWithTakeEvery() {
  yield takeEvery('TAKE_EVERY', otherSaga);
}

it('forked saga runs', () => {
  return expectSaga(saga)
    // This action comes from the forked `otherSaga`!
    .put({ type: 'FORKED' })
    .run();
});

it('takeEvery saga runs', () => {
  return expectSaga(sagaWithTakeEvery)
    // This action comes from the forked `otherSaga`!
    .put({ type: 'FORKED' })
    .dispatch({ type: 'TAKE_EVERY' })
    .run();
});

it('fork assertion passes', () => {
  return expectSaga(saga)
    // There are other assertions besides `put`
    // if you want to use them.
    .fork(otherSaga)
    .run();
});

docs/unit-testing/.body:
Unit Testing
For unit testing, Redux Saga Test Plan exports a testSaga function that
creates a mock saga for you to assert effects on. testSaga is agnostic about
your testing framework, so it simply throws if the sequence of yielded effects
don't match your assertion effects.
Pass in your generator function as the first argument. Pass in additional
arguments which will be the arguments passed on to the generator function.
// ES2015
import { testSaga } from 'redux-saga-test-plan';

// ES5
var testSaga = require('redux-saga-test-plan').testSaga;

function identity(value) {
  return value;
}

function* otherSaga() {}

function* mainSaga(x, y, z) {
  try {
    const action = yield take('HELLO');
    yield put({ type: 'ADD', payload: x + y });
    yield call(identity, action);
    yield fork(otherSaga, z);
  } catch (e) {
    yield put({ type: 'ERROR', payload: e });
  }
}

const action = { type: 'TEST' };

// saga mock                    x   y  z
const saga = testSaga(mainSaga, 40, 2, 20);

The saga mock has next and throw iterator methods, so you can advance
through the saga. Pass in arguments to next to simulate response values from
yields. Similarly pass in arguments to throw to specify the thrown error.
Each next and throw call returns an API with effect assertions. All Redux
Saga effects are available such as call, put, take, fork, etc. An
additional effect called isDone allows you to assert that the generator as
reached the end.
function identity(value) {
  return value;
}

function* otherSaga() {}

function* mainSaga(x, y, z) {
  try {
    const action = yield take('HELLO');
    yield put({ type: 'ADD', payload: x + y });
    yield call(identity, action);
    yield fork(otherSaga, z);
  } catch (e) {
    yield put({ type: 'ERROR', payload: e });
  }
}

const action = { type: 'TEST' };

let saga = testSaga(mainSaga, 40, 2, 20);

// try path
saga.next().take('HELLO');
saga.next(action).put({ type: 'ADD', payload: 42 });
saga.next().call(identity, action);
saga.next().fork(otherSaga);
saga.next().isDone();

// Or chain together
saga = testSaga(mainSaga, 40, 2, 20);
saga
  .next()
  .take('HELLO')

  .next(action)
  .put({ type: 'ADD', payload: 42 })

  .next()
  .call(identity, action)

  .next()
  .fork(otherSaga)

  .next()
  .isDone();

// catch path
const error = new Error('My Error');
saga = testSaga(mainSaga, 40, 2, 20);
saga
  .next()

  .throw(error)
  .put({ type: 'ERROR', payload: error })

  .next()
  .isDone();

